router.post("/chunk-data", async function (req, res) {
  res.writeHead(200, {
    "Content-Type": "application/json",
  });
  res.write("[");

  let index = 0;

  const interval = setInterval(async () => {
    if (index >= array.length) {
      clearInterval(interval);
      res.write("null]");
      res.end();
      return;
    }
    const element = array[index++];
    if (element) {
      const chunk = JSON.stringify(element) + ",";
      res.write(chunk);
    }
  }, 500);
});
router.get("/chunk-stream", async function (req, res) {
  res.writeHead(200, {
    "Content-Type": "application/json",
  });
  res.write("[");
  const interval = setInterval(() => {
    const chunk = JSON.stringify(generateRandomData()) + ",";
    res.write(chunk);
  }, 1000);

  req.on("close", () => {
    clearInterval(interval);
    res.write("null]");
    res.end();
    console.log("Connection closed, stopped sending chunks.");
  });
});
module.exports = router;
